‚Ä¢ The car debuted in 2019 during Monterey car week, and will be joining the Audi Sport customer racing lineup that includes the R8 LMS GT3, R8 LMS GT4, and the RS 3 LMS. The R8 LMS GT2 is special because it features the highest specification of the mechanical masterpiece we know as the naturally aspirated 5.2 liter V10 engine. It generates 640HP and, yes, it is the most powerful racecar Audi Sport Customer Racing has ever produced. The GT2 racing league will be a new racing class, where the cars feature big power, higher top speeds, and less aerodynamics than GT3 cars. The marketplace has been slow to develop, but will come overtime as this Audi and Porsche‚Äôs 911 GT2 RS Clubsport, are two of the first cars to be released for the class. The Audi LMS GT2 has over 550NM of torque, provided by the V10, which is marriaged to a 7 speed double clutch S tronic transmission. The car is very lightweight, just 1350KG dry, and has an insane power to weight ratio of 2.1KG per HP. The power is sent to the rear wheels. It stands accordingly to SRO GT2 regulations and is beyond standard in the safety category, featuring the best safety technology to date. The design of the car is very aggressive as well, and the car features a very unique look with its massive S duct, seen on the front bumper. The S duct channels air through the gaping gap forcing the front end of the car to stick to the track whilst the channeled air exits out the front hood and around the car. It‚Äôs just a thing of beauty! What a machine!‚Ä¢
