os, cada um com seu charme. Qual voc√™ achou o mais bonito? Copyright: Camille De Bastiani

Colin Chapman revolutionized F1 with innovative ideas, some crazy ones, and fantastic cars. The paintings of his bolides were always striking. Let's talk about these four models, painted on the 2013 design. From top to bottom: 1) The classic 49B driven by Graham Hill in 1969. The red and gold were elegant and luxurious, but unfortunately, the performance was bad. 2) In 1980 the Lotus 11 drew attention for its chrome fairing and strong color contrasts. It was beautiful, but Mario Andretti suffered with the car. 3) 98T, the best-known Lotus model is also one of the most beautiful due to the simplicity of the black and the refinement of the gold and gave for Ayrton Senna two victories in 1986. 4) In 1987 the team surprised the fans with a completely yellow painting. The 99T from Ayrton Senna and Satoru Nakajima was Lotus' last great car. They are all beautiful, each one with its charm. Which one did you find the most beautiful? Copyright: Camille De Bastiani

